def main():
	ret_json = {}
	csv = pd.read_csv(f"{COMMITMENTS_PATH}pgenkaptchas.txt", names=["text", "commitment"], header=None)

	for row in csv.itertuples():
		k = b"0x"+row.commitment.strip().encode()
		pngname = row.text.strip()
		with open(OUTPUT_FOLDER+"pgenkaptchas/"+pngname+".png", "rb") as png:
			encoded_string = urlsafe_b64encode(png.read()).decode("utf-8")

		ret_json[row.text] = {"png": encoded_string, "merklepath": proofs[k]}
	file = open("k.json", "w+")
	json.dump(ret_json, file)
	file.close()

